import React from 'react';

const Table=(props)=>{
    let tb=props.invoices.map((invoice,index)=>{
        return(< tr key={index}>
            <td><button onClick={()=>props.selectedIdhandler(invoice.id)}> {invoice.id}</button></td>
            <td>{invoice.name}</td>
            <td>{invoice.product}</td>
            <td>{invoice.price}</td>
        </tr>)
    })
    return (
        <table>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Product</th>
            <th>Price</th>
          </tr>
          {tb}
        </table>
    )
} 


export default Table;
